import { makeStyles } from '@mui/styles';

export default makeStyles({
  cartSection: {
    height: '317px',
  },
  imageHolder: {
    position: 'relative',
    height: '218px'
  },
  price: {
    fontFamily: 'Copperplate',
    color: 'white'
  },
  button: {
    fontFamily: 'Copperplate',
    fontWeight: 'normal',
    fontSize: '16px',
    lineHeight: '16px',
    color: 'white',
    textDecoration: 'none',
    '&:hover': {
      textDecoration: 'none',
      color: 'white'
    }
  }
})
